import React from "react";
import { Link } from "react-router-dom";

const Homepage = () => {
  return (
    <div className="container-fluid d-flex align-items-end justify-items-end homepage-container">
      <div className="container-fluid projects-container">
        <div className="project">
          <Link to="/">DEV.LIB</Link>
        </div>
        <div className="project">
          <Link to="/">DIGITAL ORGANIZER</Link>
        </div>
        <div className="project">
          <Link to="/">FULLSTACK BLOG</Link>
        </div>
      </div>
    </div>
  );
};

export default Homepage;
